// import logo from './logo.svg';
import './App.css';
import GreetClassComponent from './components/GreetClassComponent';
import TryFunctionalComponent from './components/TryFunctionalComponent';
import WelcomeFunctionalComponent from './components/WelcomeFunctionalComponent';



function App() 
{

  return (
    <div className="App">

      <WelcomeFunctionalComponent/>
      <GreetClassComponent/>
      <TryFunctionalComponent name="Raj" love="With love"/>

    </div>
  );
}

export default App;
